import React, { Component } from 'react'
import { connect } from 'react-redux'
import { getFriends } from '../actions/friends'

class Friends extends Component {
    myFunction = () => {
        this.props.onclick();
    }
    componentDidMount() {
        const user = this.props.user.user;
        this.props.dispatch(getFriends(user[0].id))
    }
    HomePage = () => (
        <div id="fb">
            <img src="/images/bean1.jpg" alt="Image of woman" />
            <p id="info"><b>Natalie G.</b> <br /> <span>14 mutual friends</span></p>
            <div id="button-block">
                <div id="confirm">Confirm</div>
                <div id="delete">Delete Request</div>
            </div>
        </div>
    );
    render() {

        const friendRequest = this.props.friendRequest;
        const length = friendRequest.length;
        console.log('inside friend user', friendRequest);
        return (
            // <div>

            //     <this.HomePage val={1} />
            //     <this.HomePage val={1} />
            // </div>
            <div>
                {(length > 0) ? (friendRequest.map((friend, i) => (
                    <this.HomePage val={1} />
                ))) : <div></div>
                }
            </div> 

        )
    }
}


const mapStateToProps = (state) => {
    return {
        user: state.user,
    };
}

export default connect(mapStateToProps)(Friends);
